%pyspark
import os
from bokeh.plotting import figure, output_file, show
class StarsBokeh(object):
    def __init__(self, data_dir="/projects/stars/m2m/var/bokeh"):
        self.data_dir = data_dir
    def output_file (self, file_name):
        output_file (os.path.join (self.data_dir, file_name))
    def show (self, p, file_name):
        show (p)
        path = os.path.join (self.data_dir, file_name)
        print ("%html {0}".format (open(path).read ()))
